import styled from 'styled-components';
import './App.css';

const BIRD_SIZE =20;

function App() {
  return (
    <div className="App">
    <Bird size={BIRD_SIZE}/>
    </div>
  );
}

export default App;

const Bird = styled.div`
position: absolute;
background-color: red;
height: ${(props) => props.size}px;
width: ${(props) => props.size}px;
top: ${(props) => props.size}px;
border-radius: 100%;
`;
